import { useEffect, Fragment } from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import LintechPicture from './assets/1673710275502.jpeg';
import axios from 'axios';

const Login = (props) => {

    const handleLogin = () => {

        props.setSwitcher(1)
    }
    return (
        <Fragment>
            <div style={{backgroundColor: 'grey', height: window.innerHeight}}>
                <CssBaseline />
                <Container maxWidth="md">
                    <Grid container justifyContent="center" alignItems="center">
                            <Card sx={{ height: '75vh', width: '75vh', marginTop: '10%', boxShadow: 10, backgroundColor: '#cbcaca', p: 2}}>
                                <CardMedia
                                    sx={{ height: '35vh'}}
                                    image={LintechPicture}
                                    title="Samgyup"
                                />
                                <CardContent>
                                    <Typography
                                        variant="h6"
                                        noWrap
                                        sx={{
                                        mr: 2,
                                        display: { xs: 'none', md: 'flex' },
                                        fontFamily: 'monospace',
                                        fontWeight: 700,
                                        letterSpacing: '.3rem',
                                        color: 'inherit',
                                        textDecoration: 'none',
                                        }}
                                    >
                                        LinTech üêÑ  ü•¨ Output Tracker
                                    </Typography>
                                    <Typography variant="body2" color="text.secondary">
                                        Pang track ng oras para hindi pagalitan ng MEAL
                                    </Typography>
                                    <Grid container sx={{p: 2}} spacing={2}>
                                        <Grid item xs={12}>
                                            <TextField
                                                required
                                                id="outlined-required"
                                                label="Username"
                                                autoComplete="off"
                                                sx={{width: '100%'}}
                                            />
                                        </Grid>
                                        <Grid item xs={12}>
                                            <TextField
                                                required
                                                id="outlined-required"
                                                label="Password"
                                                type="password"
                                                autoComplete="off"
                                                sx={{width: '100%'}}
                                            />
                                        </Grid>
                                    </Grid>
                                </CardContent>
                                <CardActions sx={{justifyContent: "flex-end", mr: 3}}>
                                    <Button variant="contained" size="medium" onClick={handleLogin}>Login</Button>
                                </CardActions>
                            </Card>
                    </Grid>
                </Container>
            </div>
        </Fragment>
    )
}

export default Login;
